import React from 'react'

    const Contacts = ({ contacts }) => {
        console.log('cont',contacts)
      return (
        <div>
          <center><h1>Contact List</h1></center>
          {contacts.businesses && contacts.businesses.map((contact) => (
            <div class="card">
              <div class="card-body">
                <h5 class="card-title">{contact.name}</h5>
                <h6 class="card-subtitle mb-2 text-muted">`${contact.location.address1} ${contact.location.address2} ${contact.location.address3}`</h6>
                {/* <p class="card-text">{contact.company.catchPhrase}</p> */}
              </div>
            </div>
          ))}
        </div>
      )
    };

    export default Contacts
